ha: string;        // La fecha la representamos como un string\n  texto?: string;        // El texto del aviso\n  fotos?: FotoUrlDTO[];     // El conjunto de fotos lo convertimos en un array de objetos FotoUrl\n  id_usuario?: number;\n  username?: string;\n\n\n}\n\n    \n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"components/AvisoPaginaComponent.html":{"url":"components/AvisoPaginaComponent.html","title":"component - AvisoPaginaComponent","body":"\n                   \n\n\n\n\n\n  Components\n  \n  AvisoPaginaComponent\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n        \n            Template\n        \n        \n            Styles\n        \n        \n            DOM Tree\n        \n\n\n\n    \n    File\n\n\n    src/app/features/home/componentes/aviso-principal/avisos-pagina/avisos-pagina.component.ts\n\n\n\n\n\n    \n        Implements\n    \n    \n                OnInit\n    \n\n\n\n    Metadata\n    \n        \n\n\n\n\n\n\n\n\n\n\n\n\n            \n                selector\n                app-aviso-pagina\n            \n\n            \n                standalone\n                true\n            \n\n            \n                imports\n                \n                            CommonModule\n                            MatButtonModule\n                \n            \n\n            \n                styleUrls\n                ./avisos-pagina.component.css\n            \n\n\n\n            \n                templateUrl\n                ./avisos-pagina.component.html\n            \n\n\n\n\n\n\n\n\n        \n    \n\n\n    \n    Index\n    \n        \n                \n                    \n                        Properties\n                    \n                \n                \n                    \n                        \n                            \n                                avisos\n                       